  return (
    <div className="titulo-home">
      <div className="titulo-paginas">
        <h1>Lista de productos</h1>
        <div className="empty-cart-message">
          <img
            src={emptyCartImageSrc}
            alt="Carrito vacío"
            className="empty-cart-image" // Aplica la clase CSS
          />
    </div>
    </div>
    </div>
  );
};
export default Inicio;
